import React from 'react';

const BlogPost = ( prop ) => {
	console.log(prop)

    let title;
    let published;
    let body;

    if (prop != undefined) {
        title = prop.title;
        published = prop.published;
        body = prop.body;

    } else {
    	title = null;
    	published = null;
        body = null;
    }

	return (

      <div className='blog-post-wrapper'>

      <h1> {title} </h1>
      <h2> {published} </h2>
      <p> {body} </p>

      </div>

	);
}

export default BlogPost;
